import React from 'react';

function NotFound() {
  return (
    <div className='h-screen'>
      <div className='flex items-center justify-center'>
        <h1 className='text-4xl mx-auto text-center self-center'>
          400 Page not found
        </h1>
      </div>
    </div>
  );
}

export default NotFound;
